import React, {Component} from 'react';
import styled from 'styled-components';
import {Switch, Route, NavLink} from "react-router-dom";


class Nav extends Component {

render() { 
    return (
   <div>
     <ul>
      <li> <NavLink to="/" exact>
         Home
       </NavLink>
       </li>
       <li> <NavLink to="/about" exact>
         About
       </NavLink>
       </li>
     </ul>

     <Switch>
     <Route path="/" component={About}/>
     </Switch>
   </div>

  );
  }
}

export default Nav;
